DECLARE @CurrentMigration [nvarchar](max)

IF object_id('[dbo].[__MigrationHistory]') IS NOT NULL
    SELECT @CurrentMigration =
        (SELECT TOP (1) 
        [Project1].[MigrationId] AS [MigrationId]
        FROM ( SELECT 
        [Extent1].[MigrationId] AS [MigrationId]
        FROM [dbo].[__MigrationHistory] AS [Extent1]
        WHERE [Extent1].[ContextKey] = N'cms4seo.Data.Migrations.Configuration'
        )  AS [Project1]
        ORDER BY [Project1].[MigrationId] DESC)

IF @CurrentMigration IS NULL
    SET @CurrentMigration = '0'

IF @CurrentMigration < '202107110335198_AutomaticMigration'
BEGIN
    CREATE TABLE [dbo].[ProductProperties] (
        [ProductId] [int] NOT NULL,
        [PropertyId] [int] NOT NULL,
        CONSTRAINT [PK_dbo.ProductProperties] PRIMARY KEY ([ProductId], [PropertyId])
    )
    CREATE TABLE [dbo].[Properties] (
        [Id] [int] NOT NULL IDENTITY,
        [Name] [nvarchar](max),
        [Value] [nvarchar](max),
        CONSTRAINT [PK_dbo.Properties] PRIMARY KEY ([Id])
    )
    ALTER TABLE [dbo].[Products] ADD [ContentWithTOC] [nvarchar](max)
    ALTER TABLE [dbo].[Products] ADD [ViewCounter] [int] NOT NULL DEFAULT 0
    ALTER TABLE [dbo].[Categories] ADD [Content] [nvarchar](max)
    ALTER TABLE [dbo].[Articles] ADD [ContentWithTOC] [nvarchar](max)
    ALTER TABLE [dbo].[Topics] ADD [Content] [nvarchar](max)
    CREATE INDEX [IX_ProductId] ON [dbo].[ProductProperties]([ProductId])
    CREATE INDEX [IX_PropertyId] ON [dbo].[ProductProperties]([PropertyId])
    ALTER TABLE [dbo].[ProductProperties] ADD CONSTRAINT [FK_dbo.ProductProperties_dbo.Products_ProductId] FOREIGN KEY ([ProductId]) REFERENCES [dbo].[Products] ([Id]) ON DELETE CASCADE
    ALTER TABLE [dbo].[ProductProperties] ADD CONSTRAINT [FK_dbo.ProductProperties_dbo.Properties_PropertyId] FOREIGN KEY ([PropertyId]) REFERENCES [dbo].[Properties] ([Id]) ON DELETE CASCADE
    INSERT [dbo].[__MigrationHistory]([MigrationId], [ContextKey], [Model], [ProductVersion])
    VALUES (N'202107110335198_AutomaticMigration', N'cms4seo.Data.Migrations.Configuration',   , N'6.1.3-40302')
END

